import React from "react";

function Header() {
  return (
    <div class="page-header">
      <div class="pull-left">
        <h1>Text on the left</h1>
      </div>
      <div class="pull-right">
        <h1 class="text-right">This to the right but on the same line</h1>
      </div>
      <div class="clearfix"></div>
    </div>
  );
}

export default Header;
